import React from "react";
import { Carousel, Col, Row, Container } from "react-bootstrap";

const about = () => {
  return (
    <Container className="container-fluid pt-5">
      <Row className="welcome text-center">
        <Col md={12}>
          <h1 className="display-4">Welcome to...</h1>
          <hr></hr>
        </Col>
        <Col md={10} xs={12} className="mx-auto">
          <p className="lead">
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi ac
            velit convallis, congue purus quis, consequat arcu. Nunc consectetur
            consectetur maximus. Vestibulum mattis erat euismod turpis
            hendrerit, ut convallis lacus venenatis. Aenean sodales id nibh eget
            faucibus. Curabitur dignissim quis justo eu ornare. Vestibulum
            euismod eros velit, ac rhoncus lorem posuere non. Aliquam
            sollicitudin eget purus vel faucibus.
          </p>
        </Col>
      </Row>
    </Container>
  );
};

export default about;
